import React, { useState } from "react";
import Item from '../components/testComponent/Item'


const Test = () =>{

    const [numbers, setNumbers] = useState([1, 2, 3]);
    const [array, setArray] = useState([]); 


    const addNumber = () => {
      setArray([...numbers]); 
        setNumbers(prev => [...prev.length + 1, prev]);
      };

    return (
      <div>
        {numbers.map(num => (
          <Item key={num} num={num}></Item>
        ))}
        <div onClick={addNumber}>Click</div>
        <input type="text" value={array.length} />
      </div>
    )

}

export default Test;
